import { Link } from "react-router-dom"
import { useParams } from "react-router-dom"

export default function Herramientas(props){
    let {productId}=useParams();
    let selectedTools = props.allproducts.filter(product=>product.id===productId);
    let selectedTool = selectedTools[0];
    return(
        <div>
            <h2><b>{selectedTool.title}</b></h2>
        </div>
    )
}
